func twoSum(numbers []int, target int) []int {

	pl := 0
	pr := len(numbers) - 1

	sum := numbers[pl] + numbers[pr]

	for {
		if sum == target {
			break
		}

		if sum < target {
			pl++
		}

		if sum > target {
			pr--
		}
		sum = numbers[pl] + numbers[pr]
	}

	return []int{pl + 1, pr + 1}

}
